// import $ from "jquery";

function clickTesteo(state) {

	console.log( `clicktesteo` );

	const cars = new Array("Saab", "Volvo", "BMW");
	
	console.log( typeof Array.isArray(cars) );
	
	state({
		list: [1, 2, 3],
	  })
	
};

export { clickTesteo }
